function jsp_displayConfirmMessage(n){if("SYSTEM_RESTORE"==n){if(1!=confirm("This will restore all factory default settings.\n\nContinue?"))return!1}else if("GATEWAY_UPDATE"==n){if(1!=confirm("This will change gateway configuration setting.\n\nContinue?"))return!1}else{if(1!=confirm("Confirm to proceed.\n\nContinue?"))return!1}}